import { Card } from "react-bootstrap";
import Link from "next/link";
import { useRouter } from "next/router";
import { route } from "next/dist/next-server/server/router";
// import { getAllIssuesIds } from "../../../lib/issues";

// export async function getStaticProps() {
//   const IssuesNames = getAllIssuesIds();
//   return {
//     props: {
//       IssuesNames,
//     },
//   };
// }

const Folder = ({ title, options }) => {
  function getIssueId(e) {
    const id = e.target.className.split(" ").join("-").toLowerCase();
    return id;
  }
  const router = useRouter();

  return (
    <Card className="folder-card">
      <div className="header">
        <h4>{title}</h4>
      </div>
      <ul>
        {options.map((option) => (
          <li>
            <Link
              href="/cudzoziemcy/[id]"
              as={`/cudzoziemcy/${router.pathname}/${option
                .split(" ")
                .join("-")
                .toLowerCase()}`}
            >
              <a onClick={getIssueId} className={option}>
                {option}
              </a>
            </Link>
            <hr className="folder-separator" />
          </li>
        ))}
      </ul>
    </Card>
  );
};

export default Folder;
